import asyncio
import websockets

# Set to store queues for connected clients
CLIENT_QUEUES = set()

async def relay_messages(queue, websocket):
    """Task to send messages from a queue to a WebSocket client."""
    try:
        while True:
            message = await queue.get()
            await websocket.send(message)
            queue.task_done()
    except websockets.exceptions.ConnectionClosedOK:
        pass # Client disconnected gracefully
    except asyncio.CancelledError:
        pass # Task cancelled during shutdown

async def websocket_handler(websocket, path):
    """Handles incoming WebSocket connections and manages client queues."""
    client_queue = asyncio.Queue()
    CLIENT_QUEUES.add(client_queue)

    relay_task = asyncio.create_task(relay_messages(client_queue, websocket))

    try:
        await websocket.wait_closed() # Wait until the client disconnects
    finally:
        CLIENT_QUEUES.remove(client_queue)
        relay_task.cancel() # Cancel the relay task

def broadcast_message(message):
    """Broadcasts a message to all connected clients."""
    for queue in CLIENT_QUEUES:
        queue.put_nowait(message)

async def main():
    """Main function to start the WebSocket server."""
    server = await websockets.serve(websocket_handler, "localhost", 8765)
    print("WebSocket server started on ws://localhost:8765")

    # Example: broadcast a message every few seconds
    async def periodic_broadcast():
        counter = 0
        while True:
            await asyncio.sleep(5)
            counter += 1
            broadcast_message(f"Broadcast message {counter}")

    broadcast_task = asyncio.create_task(periodic_broadcast())

    await server.wait_closed()
    broadcast_task.cancel()

if __name__ == "__main__":
    asyncio.run(main())
